INSERT INTO travel_agency.tour (t_id, photo, date, description, cost, tour_type, duration) VALUES (1, '/resources/photo/tour/img1.jpg', '2018-07-17', 'Этот отель расположен в 7 км от центра Тура, в деловом районе. К услугам гостей сауна, фитнес-центр и номера с ванной комнатой и телевизором с плоским экраном.
